-- ----------------------------
-- View structure for get_two_song
-- ----------------------------
DROP VIEW IF EXISTS `get_two_song`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `get_two_song` AS select `b`.`id` AS `id`,`b`.`song_name` AS `song_name`,`b`.`singer` AS `singer`,`b`.`creat_time` AS `cx_time`,`lots`.`lots_time` AS `lots_time`,(`lots`.`lots_time` < `b`.`creat_time`) AS `is_later` from (`listen_hisory` `b` join (select `a`.`song_name` AS `song_name`,`a`.`creat_time` AS `lots_time` from `listen_hisory` `a` where (`a`.`user_id` = '128074624')) `lots`) where ((`lots`.`song_name` = `b`.`song_name`) and (`b`.`user_id` = '283135753')) order by (`lots`.`lots_time` < `b`.`creat_time`) desc,`b`.`creat_time` desc;

-- ----------------------------
-- View structure for select_night_count
-- ----------------------------
DROP VIEW IF EXISTS `select_night_count`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `select_night_count` AS select count(0) AS `总次数`,date_format(`a`.`creat_time`,'%Y-%m-%d') AS `ctime`,group_concat(date_format(`a`.`creat_time`,'%h:%i:%s') separator ',') AS `时分秒` from `listen_hisory` `a` where ((`a`.`user_id` = 283135753) and (date_format(`a`.`creat_time`,'%H:%i') < '08:00') and (date_format(`a`.`creat_time`,'%H:%i') > '01:01')) group by date_format(`a`.`creat_time`,'%Y-%m-%d') order by date_format(`a`.`creat_time`,'%Y-%m-%d') desc;

-- ----------------------------
-- View structure for top30
-- ----------------------------
DROP VIEW IF EXISTS `top30`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `top30` AS select `a`.`id` AS `id`,`a`.`song_name` AS `song_name`,`a`.`singer` AS `singer`,`a`.`song_score` AS `song_score`,`a`.`user_id` AS `user_id`,`a`.`creat_time` AS `creat_time`,`a`.`song_id` AS `song_id` from `listen_hisory` `a` where (`a`.`user_id` = '283135753') order by `a`.`creat_time` desc limit 40;

SET FOREIGN_KEY_CHECKS = 1;
